import React, { useEffect, useState } from 'react';

const parseCSV = (text) => {
  const lines = text.trim().split('\n');
  const headers = lines[0].split(',').map(h => h.trim());

  return lines.slice(1).map(line => {
    const values = line.split(',');
    const row = {};
    headers.forEach((h, i) => {
      row[h] = values[i]?.trim();
    });
    return row;
  });
};

const WRSeparationScatter = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('/data/elite_leaderboard.csv')
      .then(res => {
        if (!res.ok) throw new Error('Failed to load elite_leaderboard.csv');
        return res.text();
      })
      .then(text => {
        const rows = parseCSV(text).map(d => ({
          player: d.player_name,
          Advanced_WOS: parseFloat(d.Advanced_WOS),
          exp_sep_xgb: parseFloat(d.exp_sep_xgb),
          targets: parseInt(d.play_id, 10)
        }));
        setData(rows.filter(d =>
          !isNaN(d.Advanced_WOS) &&
          !isNaN(d.exp_sep_xgb) &&
          !isNaN(d.targets)
        ));
      })
      .catch(err => setError(err.message));
  }, []);

  if (error) {
    return <div className="text-red-400">{error}</div>;
  }

  if (data.length === 0) {
    return <div className="text-gray-400">Loading chart…</div>;
  }

  /* ----- Chart config ----- */
  const width = 700;
  const height = 700;
  const padding = 90;

  const xVals = data.map(d => d.Advanced_WOS);
  const yVals = data.map(d => d.exp_sep_xgb);

  const xMin = Math.min(...xVals) - 0.05;
  const xMax = Math.max(...xVals) + 0.05;
  const yMin = Math.min(...yVals) - 0.2;
  const yMax = Math.max(...yVals) + 0.2;

  const medianY =
    [...yVals].sort((a, b) => a - b)[Math.floor(yVals.length / 2)];

  const xScale = v =>
    padding + ((v - xMin) / (xMax - xMin)) * (width - padding * 2);

  const yScale = v =>
    height - padding - ((v - yMin) / (yMax - yMin)) * (height - padding * 2);

  // Viridis-ish continuous color scale
  const colorScale = v =>
    `hsl(${220 - v * 200}, 70%, 55%)`;

  return (
    <div className="bg-gray-900 p-6 rounded-lg text-white">
      <h2 className="text-xl font-bold mb-1 text-center">
        2023 Wide Receiver Separation
      </h2>
      <p className="text-sm text-gray-400 mb-4 text-center">
        Expected vs. Created Separation
      </p>

      <svg width={width} height={height}>
        {/* Axes */}
        <line
          x1={padding}
          y1={height - padding}
          x2={width - padding}
          y2={height - padding}
          stroke="#666"
        />
        <line
          x1={padding}
          y1={padding}
          x2={padding}
          y2={height - padding}
          stroke="#666"
        />

        {/* Axis labels */}
        <text
          x={width / 2}
          y={height - 35}
          textAnchor="middle"
          fill="#aaa"
        >
          WR-Only Separation (Advanced_WOS)
        </text>

        <text
          x={-height / 2}
          y={32}
          transform="rotate(-90)"
          textAnchor="middle"
          fill="#aaa"
        >
          Expected Separation (exp_sep_xgb)
        </text>

        {/* Vertical line: x = 0 */}
        <line
          x1={xScale(0)}
          x2={xScale(0)}
          y1={padding}
          y2={height - padding}
          stroke="#888"
          strokeDasharray="6,6"
        />
        <text
          x={xScale(0) + 6}
          y={padding + 14}
          fill="#aaa"
          fontSize="11"
        >
          Creates Sep →
        </text>

        {/* Horizontal line: median expected sep */}
        <line
          x1={padding}
          x2={width - padding}
          y1={yScale(medianY)}
          y2={yScale(medianY)}
          stroke="#888"
          strokeDasharray="6,6"
        />
        <text
          x={padding + 6}
          y={yScale(medianY) - 6}
          fill="#aaa"
          fontSize="11"
        >
          Avg. Expected Sep
        </text>

        {/* Points */}
        {data.map(d => (
          <g key={d.player}>
            <circle
              cx={xScale(d.Advanced_WOS)}
              cy={yScale(d.exp_sep_xgb)}
              r={Math.sqrt(d.targets) / 2.5}
              fill={colorScale(d.Advanced_WOS)}
              opacity={0.85}
            />
            <text
              x={xScale(d.Advanced_WOS)}
              y={yScale(d.exp_sep_xgb) - 10}
              fontSize="10"
              textAnchor="middle"
              fill="white"
            >
              {d.player}
            </text>
          </g>
        ))}
      </svg>
    </div>
  );
};

export default WRSeparationScatter;
